import React from "react";
import { Link } from "react-router-dom";
import "./portfolioBlock.css";

const PortfolioBlock = ({ linkTo, text, imageAlt, imageUrl }) => {
  return (
    <Link to={linkTo} className='portfolio-block-link'>
      <div className='portfolio-block'>
        {/* Placeholder image */}
        <img src={imageUrl} alt={imageAlt} className='portfolio-block-image' />
        <p className='portfolio-block-text'>{text}</p>
      </div>
    </Link>
  );
};

export default PortfolioBlock;
